goog.provide("goog.testing.fsTest");goog.setTestOnly("goog.testing.fsTest");goog.require("goog.testing.fs");goog.require("goog.testing.fs.Blob");goog.require("goog.testing.jsunit");function testObjectUrls(){var blob=goog.testing.fs.getBlob("foo"),url=goog.testing.fs.createObjectUrl(blob);assertTrue(goog.testing.fs.isObjectUrlGranted(blob));goog.testing.fs.revokeObjectUrl(url);assertFalse(goog.testing.fs.isObjectUrlGranted(blob))}function testGetBlob(){assertEquals(new goog.testing.fs.Blob("foobarbaz").toString(),goog.testing.fs.getBlob("foo","bar","baz").toString());assertEquals(new goog.testing.fs.Blob("foobarbaz").toString(),goog.testing.fs.getBlob("foo",new goog.testing.fs.Blob("bar"),"baz").toString())}function testBlobToString(){return goog.testing.fs.blobToString(new goog.testing.fs.Blob("foobarbaz")).then(function(result){assertEquals("foobarbaz",result)})}function testGetBlobWithProperties(){assertEquals("data:spam/eggs;base64,Zm9vYmFy",new goog.testing.fs.getBlobWithProperties(["foo",new goog.testing.fs.Blob("bar")],"spam/eggs").toDataUrl())}function testSliceBlob(){myBlob=new goog.testing.fs.Blob("0123456789");actual=new goog.testing.fs.sliceBlob(myBlob,1,3);expected=new goog.testing.fs.Blob("12");assertEquals(expected.toString(),actual.toString());myBlob=new goog.testing.fs.Blob("0123456789");actual=new goog.testing.fs.sliceBlob(myBlob,0,-1);expected=new goog.testing.fs.Blob("012345678");assertEquals(expected.toString(),actual.toString())}